(140, '#1809291021499', 'C1808211035448', 31, 'Chester Min King', '2018-09-29', '2:00 pm - 3:00 pm', '00:00:00', '00:00:00', 'Helen', 'P1809080643234', 'Dog', 'German Shepherd', '1 Years old', 1, 'Done', '2018-09-29 10:21:49', 'V1808211104490', 'Carlos Almonds Valdez', '<h2><b>Subjective:</b></h2><p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces.&nbsp;</p><h2><b><br></b></h2><h2><b>Objective:</b></h2>', '', '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', '1500.00', '2000.00', '500.00'),
