(115, '2018-09-25 23:58:21', 136, '#1809250908135', '2018-09-25', '4: 00 pm - 5: 00pm', 'Randolf Irving  Asuncion', 'V1809211111435', 'P1809080643234', 'Helen', '1 Years old', '<p>helen is sick and has coughing extensively</p><p><br></p><p><b>Objective:</b></p><p>Sample</p>', 'Input Veterinarian Statement/ Observation / Treatment', 'Input Veterinarian Statement/ Observation / Treatment', '<p><b>Assessment:</b></p><p>Sample</p><p><b>Plan:</b></p><p>Sample</p>', '<p><b>Sample Prescription</b></p><p>need follow up check up</p><p><br></p>', 'Kennel Cough', 58, 'Known', ''),
