(117, '2018-09-28 02:06:58', 138, '#1809280204350', '2018-09-28', '2:00 pm - 3:00 pm', 'Carlos Almonds Valdez', 'V1808211104490', 'P1809080643234', 'Helen', '1 Years old', '<p>sasdasd</p>', 'Input Veterinarian Statement/ Observation / Treatment', 'Input Veterinarian Statement/ Observation / Treatment', '<p>Soap Writing 1</p>', '<p>need for follow up checkup</p>', 'Feline Rhinotracheitis', 73, 'Known', ''),
(118, '2018-09-28 13:31:38', 139, '#1809280123310', '2018-09-28', '2:00 pm - 3:00 pm', 'Carlos Almonds Valdez', 'V1808211104490', 'P1809080643234', 'Helen', '1 Years old', '<p>Subjective:</p><p>Helen is green</p><p>Objective:</p><p>Helen looks pale</p>', 'Input Veterinarian Statement/ Observation / TreatmentInput Veterinarian Statement/ Observation / Treatment', 'Input Veterinarian Statement/ Observation / TreatmentInput Veterinarian Statement/ Observation / Treatment', '<p>Assessment</p><p>?Sample<br></p><p>Plan</p><p>?Sample number 1<br></p>', '<p>bring helen <b>2 weeks</b> from now for follow up checkup</p>', 'Feline Rhinotracheitis', 73, 'Known', ''),
(119, '2018-09-29 10:26:49', 140, '#1809291021499', '2018-09-29', '2:00 pm - 3:00 pm', 'Carlos Almonds Valdez', 'V1808211104490', 'P1809080643234', 'Helen', '1 Years old', '<h2><b>Subjective:</b></h2><p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces.&nbsp;</p><h2><b>Objective:</b></h2><p><b></b> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces. <b><br></b></p>', 'Input Veterinarian Statement/ Observation / Treatment', 'Input Veterinarian Statement/ Observation / TreatmentInput Veterinarian Statement/ Observation / Treatment', '<h2><b>Treatment:</b></h2><p><b> {a} General pathophysiologic mechanisms and {b} Mechanisms most likely in this case: <br>{a} Non-gastrointestinal diseases such as hypoadrenocorticism, chronic renal failure, and hepatic disease can produce diarrhea.  {b} There is no evidence for these on physical examination or laboratory data, although hypoalbuminemia could be a reflection of poor hepatic function, and not all hepatic disease will be accompanied by abnormal liver enzyme activities  <br>Primary gastrointestinal disease:  Malassimilation seems most appropriate. <br> <br>{a} Maldigestion due to exocrine pancreatic insufficiency is one possible explanation.  Undigested nutrients cannot be absorbed and provide substrate for intestinal bacteria.  The result is osmotic diarrhea.  {b} In Ichiro, the results of the TLI do not support this DfDx.  It may be useful to repeat the test (see below). <br> <br></b></p><h2><b>Assessment:</b></h2><p><b>{a} A small intestinal malabsorption syndrome is a good consideration.  The decreased ability to absorb nutrients, typically due to an infiltrative mucosal disease, creates an osmotic diarrhea and weight loss.  Depending on the cause of the malabsorption there may also be a significant exudative component to the diarrhea as water and other components of the interstitial fluid or plasma are lost into the intestinal lumen.  Low serum cobalamin could be seen with severe ileal inflammation causing poor absorption of cobalamin.  Likewise upper intestinal malabsorption may result in lower than normal folate levels.  {b} Hypoalbuminemia is consistent with these diseases due to increased loss (a protein-losing enteropathy; PLE) and/or malabsorption.  More commonly, however, BOTH albumin and globulin (a larger molecule) are lost with PLE. <br> <br></b></p>', '<p>Buy this medicines</p><p></p><ul><li>oceda clamaka 2shoots/day</li><li>vitamins 4/day</li></ul><br>bring him after <b>2weeks</b><p></p>', 'Kennel Cough', 58, 'Known', ''),
(120, '2018-10-01 17:17:07', 141, '#1810010509155', '2018-10-01', '4: 00 pm - 5: 00pm', 'Carlos Almonds Valdez', 'V1808211104490', 'P1809080643234', 'Helen', '1 Years old', '<h1><b>Subjective</b></h1><p>Emergency</p><h1><b>Objective</b></h1><p><b><br></b></p><p><b>sample</b></p>', 'Input Veterinarian Statement/ Observation / Treatment', 'Input Veterinarian Statement/ Observation / Treatment', '<h1><b>Assessment</b></h1><p><b>sample<br></b></p><h1><b>Plan</b></h1><p><b>sample<br></b></p>', '<p>sample</p>', 'Kennel Cough', 58, 'Known', ''),
(121, '2018-10-07 11:31:57', 145, '#1810041042552', '2018-10-07', '9:00 am - 10:00 am', 'Randolf Irving  Asuncion', 'V1809211111435', 'P1809080643234', 'Helen', '1 Years old', '<p>hahahhha</p>', '<p>objective</p>', '<p>assessment</p>', '<p>plan</p>', '<p>wala</p>', 'Feline Rhinotracheitis', 73, 'Known', ''),
(122, '2018-10-15 04:19:32', 149, '#1810150415585', '2018-10-15', '9:00 am - 10:00 am', 'Carlos Almonds Valdez', 'V1808211104490', 'P1809080643234', 'Helen', '1 Years old', '<p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces. <br> </p>', '<p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces. <br> <br></p>', '<p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces. <br> <br></p>', '<p> Diarrhea in this animal is chronic and appears to be progressing (getting worse).  The high volume &amp; low frequency suggests that the diarrhea is small intestinal in origin, as does the absence of fresh blood, mucus, and tenesmus, which are the cardinal signs of large bowel diarrhea in small animals.  The chronic small bowel diarrhea accompanied by weight loss is most suggestive of a small intestinal malassimilation syndrome, possibly with protein loss into the feces. <br> <br></p>', '<p>bring him to me now()</p>', 'Feline Rhinotracheitis', 73, 'Known', '');
