INSERT INTO `tbl_petbreeds` (`breed_id`, `pettype_id`, `pettype_code`, `pet_breed`, `breed_description`, `breed_status`) VALUES
(12, 2, 'cat', 'British Shorthair', '<p>\r\n\r\nThe British Shorthair is the pedigreed version of the traditional British domestic cat, with a distinctively chunky body, dense coat and broad face.&nbsp;</p><p>Origin : Great Britain</p><p>Scientific Name: Felis Catus</p><p><small></small><br></p>', ''),
(13, 2, 'cat', 'Maine Coon', '<p>\r\n\r\nThe Maine Coon is one of the largest domesticated breeds of cat. It has a distinctive physical appearance and valuable hunting skills . and Special Skills</p><p><br></p><p>Scientific Name:&nbsp;\r\n\r\nFelis catus\r\n\r\n</p>', ''),
(15, 2, 'cat', 'Ragdoll', '<p>\r\n\r\nThe Ragdoll is a cat breed with blue eyes and a distinct colourpoint coat. It is a large and muscular semi-longhair cat with a soft and silky coat. Like all long haired cats, Ragdolls need grooming to ensure that their fur does not mat\r\n\r\n<br></p>', ''),
(16, 2, 'cat', 'Siamese Cat', '<p>\r\n\r\nThe Siamese cat is one of the first distinctly recognized breeds of Asian cat. Derived from the Wichianmat landrace, one of several varieties of cat native to Thailand\r\n\r\n<br></p>', ''),
(17, 1, 'dog', 'Chihuahua', '<p>\r\n\r\nThe Chihuahua is the smallest breed of dog and is named after the state of Chihuahua in Mexico. Chihuahuas come in a wide variety of colors, and two coat lengths .<br></p><p>Scientific Name:Copernicus Pepitucus</p><p>Life Span: 12  20 years\r\n\r\n<br></p>', ''),
(18, 1, 'dog', 'German Shepherd', '<p>\r\n\r\nThe German Shepherd is a breed of medium to large-sized working dog that originated in Germany. The breed\'s officially recognized name is German Shepherd Dog in the English language. The breed is known as the Alsatian in Britain and Ireland.\r\n\r\n<br></p><p><br></p><p>Life span:&nbsp;\r\n\r\n9  13 years\r\n\r\n</p>', ''),
(19, 1, 'dog', 'Golden Retriever', '<p>\r\n\r\nThe Golden Retriever is a large-sized breed of dog bred as gun dogs to retrieve shot waterfowl such as ducks and upland game birds during hunting and shooting parties, and were named \'retriever\'\r\n\r\n<br></p><p><br></p><p>Life span: 10  12 years&nbsp;</p>', ''),
(20, 1, 'dog', 'Labrador Retriever', '<p>\r\n\r\nThe Labrador Retriever, or just Labrador, is a type of retriever-gun dog. The Labrador is one of the most popular breeds of dog in Canada, the United Kingdom and the United States\r\n\r\n<br></p><p><br></p><p>Life span :<small>&nbsp;\r\n\r\n10  14 years\r\n\r\n</small></p>', ''),
(21, 1, 'dog', 'Bulldog', '<p>\r\n\r\nThe Bulldog, also known as the English Bulldog or British Bulldog, is a medium-sized breed of dog. It is a muscular, hefty dog with a wrinkled face and a distinctive pushed-in nose.&nbsp;<br></p><p>Life Span: 8 - 10 years</p>', 'Active'),
(22, 1, 'dog', 'Beagle', '<p>\r\n\r\nThe Beagle is a breed of small hound that is similar in appearance to the much larger foxhound. The beagle is a scent hound, developed primarily for hunting hare.\r\n\r\n<br></p><p>Life span: 12 - 15 years</p>', 'Active'),
(23, 1, 'dog', 'Poodle', '<p>\r\n\r\nThe poodle is a group of formal dog breeds, the Standard Poodle, Miniature Poodle and Toy Poodle. The origin of the breed is still discussed, with a prominent dispute over whether the poodle descends from Germany as a type of water dog, or from the French Barbet.\r\n\r\n<br></p><p>Life span: 12 - 15 years</p>', 'Active'),
(24, 1, 'dog', 'Pug', '<p>\r\n\r\nThe Pug is a breed of dog with physically distinctive features of a wrinkly, short-muzzled face, and curled tail. The breed has a fine, glossy coat that comes in a variety of colours, most often fawn or black, and a compact square body with well-developed muscles.\r\n\r\n<br></p><p>Life span: 12 - 15 years</p>', 'Active'),
(25, 1, 'dog', 'Rottweiler', '<p>\r\n\r\nThe Rottweiler is a breed of domestic dog, regarded as medium-to-large or large. The dogs were known in German as Rottweiler Metzgerhund, meaning Rottweil butchers\' dogs, because their main use was to herd livestock and pull carts laden with butchered meat to market.\r\n\r\n<br></p><p>Life span: 8 - 10 years</p>', 'Active'),
(26, 1, 'dog', 'Siberian Husky', '<p>\r\n\r\nThe Siberian Husky is a medium size working dog breed that originated in Northeast Asia. The breed belongs to the Spitz genetic family. With proper training, they make great home pets and sled dogs. It is recognizable by its thickly furred double coat, erect triangular ears, and distinctive markings.\r\n\r\n<br></p><p>Life span: 12 - 15 years</p>', 'Active'),
(27, 1, 'dog', 'Boxer', '<p>\r\n\r\nThe Boxer is a medium-sized, short-haired breed of dog, developed in Germany. The coat is smooth and tight-fitting; colors are fawn or brindled, with or without white markings, and white.\r\n\r\n<br></p><p>Life span: 10 - 12 years</p>', 'Active'),
(28, 1, 'dog', 'Dobermann', '<p>\r\n\r\nThe Dobermann, or Doberman Pinscher in the United States and Canada, is a medium-large breed of domestic dog that was originally developed around 1890 by Karl Friedrich Louis Dobermann, a tax collector from Germany. The Dobermann has a long muzzle. It stands on its pads and is not usually heavy-footed.\r\n\r\n<br></p><p>Life span: 10 - 13 years</p>', 'Active'),
(29, 1, 'dog', 'French Bulldog', '<p>\r\n\r\nThe French Bulldog, also known as Frenchie, is a small breed of domestic dog. Frenchies were the result in the 1800s of a cross between bulldog ancestors imported from England and local ratters in Paris, France.\r\n\r\n<br></p><p>Life span: 10 - 12 years</p>', 'Active'),
(30, 1, 'dog', 'Chow Chow', '<p>\r\n\r\nThe Chow Chow is a dog breed originally from northern China, where it is referred to as Songshi Quan, which means \"puffy-lion dog\". The breed has also been called the Tang Quan, \"Dog of the Tang Empire\".\r\n\r\n<br></p><p>Life span: 9 - 15 years</p>', 'Active'),
(31, 1, 'dog', 'Shih Tzu', '<p>\r\n\r\nA Shih Tzu, also known as the Chrysanthemum Dog, is a toy dog breed, weighing from 4 to 7.25 kilograms when fully grown. The exact origins of the breed are unknown, but it is thought to have originated in the Tibetan Plateau, and then been developed in China.\r\n\r\n<br></p><p>Life span: 10 - 16 years</p>', 'Active'),
(32, 1, 'dog', 'Dachshund', '<p>\r\n\r\nThe dachshund is a short-legged, long-bodied, hound-type dog breed. The standard size dachshund was developed to scent, chase, and flush out badgers and other burrow-dwelling animals, while the miniature dachshund was bred to hunt smaller prey such as rabbits.\r\n\r\n<br></p><p>Life span: 12 - 16 years</p>', 'Active'),
(33, 1, 'dog', 'Akita', '<p>\r\n\r\nThe Akita is a large breed of dog originating from the mountainous northern regions of Japan. There are two separate varieties of Akita: a Japanese strain, commonly called \"Akita Inu\", or \"Japanese Akita\"; and an American strain, known as the \"Akita\" or \"American Akita\".\r\n\r\n<br></p><p>Life span: 10 - 15 years</p>', 'Active'),
(34, 1, 'dog', 'Pembroke Welsh Corgi', '<p>\r\n\r\nThe Pembroke Welsh Corgi is a cattle herding dog breed which originated in Pembrokeshire, Wales. It is one of two breeds known as a Welsh Corgi. The other is the Cardigan Welsh Corgi, and both descend from the line that is the northern spitz-type dog.\r\n\r\n<br></p><p>Life span: 12 - 14 years</p>', 'Active'),
(35, 1, 'dog', 'Pit Bull', '<p>\r\n\r\nPit bull is the common name for a type of dog descended from bulldogs and terriers. Formal breeds often considered to be of the pit bull type include the American Pit Bull Terrier, American Staffordshire Terrier, American Bully, and Staffordshire Bull Terrier. The American Bulldog is also sometimes included.\r\n\r\n<br></p><p>Life span: 8 - 15 years</p>', 'Active'),
(36, 1, 'dog', 'Greyhound', '<p>\r\n\r\nThe Greyhound is a breed of dog; a sighthound which has been bred for coursing game and Greyhound racing. Since the rise in large-scale adoption of retired racing Greyhounds, the breed has seen a resurgence in popularity as a family pet.\r\n\r\n<br></p><p>Life span: 10 - 12 years</p>', 'Active'),
(37, 1, 'dog', 'Alaskan Malamute', '<p>\r\n\r\nThe Alaskan Malamute is a large breed of domestic dog originally bred for hauling heavy freight due to their strength and endurance, and later as a sled dog. They are similar to other arctic breeds and spitz breeds, such as the Greenland Dog, Canadian Eskimo Dog, the Siberian Husky, and the Samoyed.\r\n\r\n<br></p><p>Life span: 10 - 12 years</p>', 'Active'),
(38, 1, 'dog', 'St. Bernard', '<p>\r\n\r\nThe St. Bernard or St Bernard is a breed of very large working dog from the western Alps. They were originally bred for rescue at the Great St Bernard Pass on the Italian-Swiss border, and Little St Bernard Pass in the Italian-French border, located close to one another.\r\n\r\n<br></p><p>Life span: 8 - 10 years</p>', 'Active'),
(39, 1, 'dog', 'Dalmatian', '<p>\r\n\r\nThe Dalmatian is a breed of medium-sized dog, noted for its unique black or liver spotted coat and mainly used as a carriage dog in its early days. Its roots trace back to Croatia and its historical region of Dalmatia.\r\n\r\n<br></p><p>Life span: 10 - 13 years</p>', 'Active'),
(40, 1, 'dog', 'Boston Terrier', '<p>\r\n\r\nThe Boston Terrier is a breed of dog originating in the United States of America. This \"American Gentleman\" was accepted in 1893 by the American Kennel Club as a non-sporting breed. Color and markings are important when distinguishing this breed to the AKC standard.\r\n\r\n<br></p><p>Life span: 13 - 15 years</p>', 'Active'),
(41, 1, 'dog', 'Havanese', '<p>\r\n\r\nThe Havanese, a breed of Bichon type, is the national dog of Cuba, developed from the now extinct Blanquito de la Habana. The Blanquito descended from the also now extinct Bichon Tenerife.</p><p>Life span: 13 - 15 years</p>', 'Active'),
(42, 2, 'cat', 'Russian Blue', '<p>\r\n\r\nThe Russian Blue is a cat breed that comes in colors varying from a light shimmering silver to a darker, slate grey. They develop close bonds with their owners and are sought out as pets due to their personalities, beauty and coat.\r\n\r\n<br></p>', 'Active'),
(43, 2, 'cat', 'Persian Cat', '<p>\r\n\r\nThe Persian cat is a long-haired breed of cat characterized by its round face and short muzzle. It is also known as the \"Persian Longhair\" in the English-speaking countries. In the Middle East region they are widely known as \"Iranian cat\" and in Iran they are known as \"Shirazi cat\".\r\n\r\n<br></p>', 'Active'),
(44, 2, 'cat', 'Abyssinian Cat', '<p>\r\n\r\nThe Abyssinian is a breed of domestic short-haired cat with a distinctive \"ticked\" tabby coat, in which individual hairs are banded with different colors. The breed is named for Abyssinia, from which it supposedly originated.\r\n\r\n<br></p>', 'Active'),
(45, 2, 'cat', 'Sphynx Cat', '<p>\r\n\r\nThe Sphynx cat is a breed of cat known for its lack of coat. It was developed through selective breeding, starting in the 1960s. The skin should have the texture of chamois, as it has fine hairs. Whiskers may be present, either whole or broken, or may be totally absent.\r\n\r\n<br></p>', 'Active'),
(46, 2, 'cat', 'Munchkin cat', '<p>\r\n\r\nThe Munchkin or Sausage Cat is a new breed of cat characterized by its very short legs, which are caused by a genetic mutation. Much controversy erupted over the breed when it was recognized by The International Cat Association in 1995 with critics voicing concern over potential health and mobility issues.<br></p>', 'Active'),
(47, 2, 'cat', 'Scottish Fold', '<p>\r\n\r\nThe Scottish Fold is a breed of domestic cat with a natural dominant-gene mutation that affects cartilage throughout the body, causing the ears to \"fold,  bending forward and down towards the front of the head, which gives the cat what is often described as an \"owl-like\" appearance.\r\n\r\n<br></p>', 'Active'),
(48, 2, 'cat', 'Norwegian Forest cat', '<p>\r\n\r\nThe Norwegian Forest cat is a breed of domestic cat originating in Northern Europe. This natural breed is adapted to a very cold climate, with a top coat of glossy, long, water-shedding hairs and a woolly undercoat for insulation.\r\n\r\n<br></p>', 'Active'),
(49, 2, 'cat', 'Turkish Angora', '<p>\r\n\r\nThe Turkish Angora is a breed of domestic cat. Turkish Angoras are one of the ancient, natural breeds of cat, having originated in central Turkey, in the Ankara region.\r\n\r\n<br></p>', 'Active'),
(50, 2, 'cat', 'Birman', '<p>\r\n\r\nThe Birman, also called the \"Sacred Cat of Burma\", is a domestic cat breed. The Birman is a long-haired, color-pointed cat distinguished by a silky coat, deep blue eyes, and contrasting white \"gloves\" or \"socks\" on each paw. The breed name is derived from Birmanie, the French form of Burma.<br></p>', 'Active'),
(51, 2, 'cat', 'Bengal cat', '<p>\r\n\r\nThe Bengal is a domestic cat breed developed to look like exotic jungle cats such as leopards, ocelots, margays and clouded leopards.\r\n\r\n<br></p>', 'Active'),
(52, 2, 'cat', 'Burmese cat', '<p>\r\n\r\nThe Burmese cat is a breed of domestic cat, believed to have its roots near the present Thai-Burma border and developed in the United States and Britain.\r\n\r\n<br></p>', 'Active'),
(53, 2, 'cat', 'Himalayan cat', '<p>\r\n\r\nThe Himalayan, is a breed or sub-breed of long-haired cat identical in type to the Persian, with the exception of its blue eyes and its point colouration, which were derived from crossing the Persian with the Siamese.\r\n\r\n<br></p>', 'Active'),
(54, 2, 'cat', 'Siberian cat', '<p>\r\n\r\nThe Siberian is a landrace variety of domestic cat, present in Russia for centuries, and more recently developed as a formal breed, with standards promulgated since the late 1980s. They vary from medium to medium-large in size.\r\n\r\n<br></p>', 'Active'),
(55, 2, 'cat', 'American Shorthair', '<p>\r\n\r\nThe American Shorthair is a breed of domestic cat believed to be descended from European cats brought to North America by early settlers to protect valuable cargo from mice and rats. According to the Cat Fancier\'s Association, in 2012, it was the seventh most popular pedigreed cat in the United States.\r\n\r\n<br></p>', 'Active'),
(56, 2, 'cat', 'Egyptian Mau', '<p>\r\n\r\nEgyptian Maus are a small- to medium-sized short-haired cat breed. Along with the Bahraini Dilmun cat, they are one of the few naturally spotted breeds of domesticated cat. The spots of the Mau occur on only the tips of the hairs of its coat. It is considered to be a rare breed.\r\n\r\n<br></p>', 'Active'),
(57, 2, 'cat', 'Balinese cat', '<p>\r\n\r\nThe Balinese is a long-haired breed of domestic cat with Siamese-style point coloration and sapphire-blue eyes.\r\n\r\n<br></p>', 'Active'),
(58, 2, 'cat', 'Manx cat', '<p>\r\n\r\nThe Manx cat is a breed of domestic cat originating on the Isle of Man, with a naturally occurring mutation that shortens the tail.\r\n\r\n<br></p>', 'Active'),
(59, 2, 'cat', 'Ragamuffin cat', '<p>\r\n\r\nThe Ragamuffin is a breed of domestic cat. It is a variant of the Ragdoll cat and was established as a separate breed in 1994. Ragamuffins are notable for their friendly personalities and thick, rabbitlike fur.\r\n\r\n<br></p>', 'Active'),
(60, 2, 'cat', 'Snowshoe cat', '<p>\r\n\r\nThe Snowshoe is a breed of cat originating in the United States of America in the 1960s. Snowshoes were first produced in Philadelphia when a Siamese breeder\'s cat gave birth to three kittens with white feet.\r\n\r\n<br></p>', 'Active'),
(61, 2, 'cat', 'Khao Manee', '<p>\r\n\r\nThe Khao Manee cat, or Khao Plot, also known as the Diamond Eye cat, is a rare breed of cat originating in Thailand, which has an ancient ancestry tracing back hundreds of years. They are mentioned in the Tamra Maew, or Cat Book Poems. Khao Manee cats are pure white with a short, smooth, close-lying coat.\r\n\r\n<br></p>', 'Active'),
(62, 2, 'cat', 'Thai cat', '<p>\r\n\r\nThe Thai cat or Wichien Maat is a newly renamed but old cat breed, related to but distinct from the Western, modern Siamese cat.\r\n\r\n<br></p>', 'Active');
