INSERT INTO `tbl_pet_library_content` (`content_id`, `library_id`, `article_contents`) VALUES
(56, 58, '<p>\r\n\r\n<a href=\"https://veterinarypartner.vin.com/vetzinsight/default.aspx?pid=756&amp;catId=5860&amp;Id=8115910\" target=\"_blank\" rel=\"nofollow\">Kennel cough</a>&nbsp;is an infectious bronchitis of dogs characterized by a harsh, hacking cough that most people describe as sounding like something stuck in my dogs throat. This bronchitis may be of brief duration and mild enough to warrant no treatment at all or it may progress all the way to a life-threatening pneumonia depending on which infectious agents are involved and the immunological strength of the patient. An uncomplicated kennel cough runs a course of a week or two and entails frequent fits of coughing in a patient who otherwise feels active and normal. Uncomplicated cases do not involve fever or listlessness, just lots of coughing.\r\n\r\n<br></p>'),
(57, 58, '<p>\r\n\r\nNumerous organisms may be involved in a case of kennel cough; it would be unusual for only one agent to be involved. Infections with the following organisms frequently occur concurrently to create a case of kennel cough:&nbsp;</p><p>\r\n\r\n</p><ul><li><em>Bordetella bronchiseptica</em>&nbsp;(bacteria)<a target=\"_blank\" rel=\"nofollow\" href=\"http://www.veterinarypartner.com/Content.plx?P=A&amp;S=0&amp;C=0&amp;A=1758\"></a></li><li>Parainfluenza virus</li><li>Adenovirus type 2</li><li>Canine distemper virus</li><li>Canine influenza virus</li><li>Canine herpesvirus (very young puppies)</li><li><em>Mycoplasma canis</em>&nbsp;(a single-cell organism that is neither virus nor bacterium)</li><li>Canine reovirus</li><li>Canine respiratory coronavirus.</li></ul>\r\n\r\n<br><p></p>'),
(58, 58, '<p>\r\n\r\n</p><p>How is Diagnosis Made?</p><p>A coughing dog that has a poor appetite, fever, and/or listlessness should be evaluated for pneumonia.</p><p>Usually the history of exposure to a crowd of dogs within the proper time frame, plus typical examination findings (coughing dog that otherwise feels well) is adequate to make the diagnosis. Radiographs show bronchitis and are particularly helpful in determining if there is a complicating pneumonia.</p><p>Recently, PCR (polymerase chain reaction) panels have become available in many reference laboratories. Using technology to amplify the presence of DNA in a swab, the lab is able to test for most of the kennel cough infectious agents listed. This knowledge is helpful in guiding therapy and understanding expectations.</p>\r\n\r\n<br><p></p>'),
(59, 59, 'A dog can have both infections at the same time. Granulocytic anaplasmosis is more common. Anaplasmosis is a tick-borne disease. Two forms of anaplasmosis are known: granulocytic anaplasmosis and infectious cyclic thrombocytopenia.\r\n\r\nTransmission is via a tick vector (a vector is an organism that can passively carry and transmit disease). A tick needs to be attached for a minimum of 24 hours to transmit the organism. Incubation time is about 1 to 2 weeks. Reservoir hosts (a source of infection and possible reinfection that sustains a parasite) are usually small rodents, deer, etc.'),
(60, 59, '<p>\r\n\r\n</p><p><strong>Diagnosis</strong></p><p>Blood tests and a urinalysis are the main diagnostic tools for anaplasmosis. The blood tests usually include a complete blood count, blood smear evaluation, biochemistry panel, serology to look for antibodies, and polymerase chain reaction (PCR) assays. If the dog is lame, radiographs and analysis of joint fluid are usually included.</p>\r\n\r\n<br><p></p>'),
(61, 59, '<p>\r\n\r\n</p><p><strong>Treatment</strong></p><p>Treatment includes antibiotics, pain relievers, and anti-inflammatory drugs.</p><p><a target=\"_blank\" rel=\"nofollow\" href=\"http://www.veterinarypartner.com/Content.plx?P=A&amp;S=0&amp;C=0&amp;A=642\">Doxycycline</a>&nbsp;is the most commonly used antibiotic. Most dogs respond within one to two days after they first take doxycycline. Other antibiotic options are tetracycline or minocycline.</p><p>Analgesia and anti-inflammatory drugs may be needed for joint pain. Let your veterinarian choose the anti-inflammatory, rather than choosing and dosing it yourself, because dogs metabolize these medicines differently than humans do. Your veterinarian will have the most appropriate medication.</p>\r\n\r\n<br><p></p>'),
(62, 60, 'Ehrlichia, named for the Dr. Ehrlich who first described them, are a type of bacteria that infect and live within the white blood cells of their hosts. Different types of Ehrlichia live in different types of white blood cells. Hosts can be human, pet, or wild animals. Ehrlichia are spread from host to host by tick bites and their intracellular location makes them difficult to remove as most antibiotics do not penetrate to the inside of cells.'),
(64, 62, '<b><h1>Kennel Cough</h1><p><br></p></b><b>W</b>hat is Kennel Cough??<div>Kennel cough is a cough.</div>'),
(65, 63, 'COntent'),
(66, 64, 'Animal teeth and claws easily puncture skin, introducing bacteria under the skin. If the skin heals quickly, the bacteria become trapped and create pockets of infection commonly referred to as abscesses.&nbsp;<div><br></div><div>&nbsp;Abscesses may be very small or extraordinarily large, and may feel swollen and warm. These are often extremely painful. Typically, animals with abscesses become depressed, and may tend to hide in inconspicuous places. Occasionally abscesses may rupture prior to the onset of any other signs. Abscesses of the anal glands are common and can be mistaken for rectal bleeding if they rupture. They may cause the pet to \"scoot\" the rectal area on the ground. Tooth root abscesses typically form just below the eye, and start as a bump or swelling. They may break open and bleed, and the pet may stop eating due to the pain or experience pain upon chewing.&nbsp;</div><div><br></div><div>Small, uncomplicated abscesses may respond to medical therapy, while larger and more extensive abscesses may require surgical treatment. Proper surgical management of abscesses often requires placing a drain or latex tubing (either under sedation or general anesthesia) to provide an escape route for secretions from the wound\'s damaged tissues.</div><div><br></div><div>Tooth root abscesses require tooth extraction  antibiotics alone will only lead to a temporary solution, but the abscess will recur unless the affected tooth is pulled. This surgery requires general anesthesia.</div>'),
(67, 64, '<b>What to Do:&nbsp;</b><div><br></div><div>&nbsp;Abscesses should be examined by a veterinarian as soon as possible and within 24 hours.&nbsp;</div><div>&nbsp;</div><div>- Fluid may normally drain from the site of an abscess. An abscess does not drain through the tube, but rather around the latex tubing. Therefore, it is important for you to clean the area around the drain if directed to do so by your veterinarian.</div><div><br></div><div>- Apply a hot compress to the affected site at least two times daily for 3 to 5 days after your pet leaves the hospital. Wet a clean washcloth with very warm water and place it directly over the affected site, and then apply gentle pressure ideally for 5 to 10 minutes.</div><div><br></div><div>- Be sure you and/or other family members wash your hands thoroughly after contacting any fluids draining from the abscess site.&nbsp;</div><div><br></div><div>- Be sure to give all prescribed medications exactly and completely as detailed by your pet\'s veterinarian. Some patients may appear to feel better after only a few days of treatment; however, it is crucial for medications to be administered according to schedule to prevent the infection from recurring.</div><div><br></div><div>- Restrict your pet to indoor activities until the infection has resolved completely.&nbsp;\r\n</div><div><br></div><div>Notify your pet\'s doctor should your pet experience any of the following:&nbsp;</div><div>- Increased redness and/or heat from the site of abscess&nbsp;</div><div>- Failure of the abscess to heal&nbsp;</div><div>- Worsening of your pet\'s general health&nbsp;</div><div>- Loss of appetite lasting longer than 24 hours<br></div>'),
(68, 64, 'What NOT to Do:<div><br></div><div>- Do not attempt to open the abscess yourself.&nbsp;</div><div><br></div><div>- Do not attempt compressing the wounds of a fractious cat. Your safety is of utmost importance to us. Contact your veterinarian for assistance should this situation arise.&nbsp;</div><div><br></div><div>- Do not apply medicines, human medications (such as Tylenol/acetaminophen or Advil/Ibuprofen), or any home remedies unless directed by a veterinarian.</div>'),
(69, 65, 'The term hemorrhagic gastroenteritis basically means inflammation of the stomach and intestine with bleeding. This kind of bleeding inflammation might be seen in patients with parvovirus infection, pancreatitis, inflammatory bowel disease or any number of other conditions but when the term HGE is used, it usually refers to a more specific canine syndrome and is an entity in and of itself. To clarify terminology, HGE has been renamed AHDS, which stands for acute hemorrhagic diarrhea syndrome. Because this change in nomenclature is recent, you may hear veterinary personnel using either term, but regardless they are referring to the specific syndrome that we will now describe.<div><br></div><div>Acute hemorrhagic diarrhea syndrome is a potentially life-threatening intestinal condition of an otherwise healthy dog, which manifests as sudden onset bloody, watery diarrhea. The symptoms are extremely dehydrating, often much more than might be expected from the amount of diarrhea, and if it is not promptly treated, the dog can go into shock and can die.&nbsp;</div><div><br></div><div>Vomiting is often part of the syndrome; in fact 80 percent of patients experience vomiting approximately 10 hours prior to the dramatic bloody diarrhea and about half the time vomiting contains obvious blood. The good news is that with hospitalization and treatment, most dogs recover rapidly. It is crucial to identify AHDS and rule out other serious conditions promptly so that the dog can get the correct treatment and the pet\'s family can have proper expectations.</div>'),
(70, 65, '<b>How is this Condition Diagnosed?&nbsp;</b><div><br></div><div>There are no specific tests for AHDS but a test called a packed cell volume (also called PCV or hematocrit) is helpful in making the diagnosis. This test can be performed in most veterinary hospitals using a few drops of blood. The percentage of the blood volume made up by red blood cells is measured. A normal PCV for a healthy dog would be 37-55 percent, meaning 37-55 percent of the blood volume should be red blood cells; the rest is fluid and white blood cells. When the patient becomes really dehydrated, there is less fluid in the bloodstream and the percentage of blood fluid drops (and consequently the percentage of red blood cells rises). In other words, the seriously dehydrated patient has a very high PCV.</div>'),
(71, 65, 'The measurement of the PCV also usually includes some sort of measurement of total protein (sometimes called total solids). In AHDS, the total protein measurement from the blood sample is paradoxically normal or low.&nbsp;<div><br></div><div>There are several aspects to the AHDS syndrome and they do not all have to be there to make the diagnosis. The syndrome elements your veterinarian will be looking for are:&nbsp;</div><div><br></div><div>- Elevated PCV of 57% or more&nbsp;</div><div>- Relatively low total protein&nbsp;</div><div>- At least one episode of vomiting (with or without blood) approximately 10 hours prior to the diarrhea\r\nA watery, very bloody diarrhea that looks almost like pure blood</div><div>- Relatively young dog (median age is five years)&nbsp;</div><div>- Relatively small dog (median size 25 lbs)&nbsp;</div><div>- Rapid response to intravenous fluids&nbsp;</div><div><br></div><div>As noted, there are many causes of a bloody diarrhea like this, including intestinal foreign body that requires surgery. Expect your veterinarian to need other tests to rule out other potentially more serious conditions.</div>'),
(72, 65, 'What Causes AHDS?\r\n\r\nThere are still many unknown factors but the cause appears to begin with infection from an intestinal bacterium called Clostridium perfringens Type A. This organism produces two toxins called NET E and NET F, which are different from the usual Clostridial enterotoxin that is well known to cause diarrhea. The toxin ulcerates the intestinal lining and the intestinal blood vessels become permeable to fluid. In this way, fluid is lost into the intestine dehydrating the patient and the PCV rises while the ulcers are responsible for the bleeding.'),
(73, 65, '<b>Treating AHDS</b>&nbsp;<div><br></div><div>The heart of therapy is aggressive fluid replacement. The idea is to get the PCV back to the normal range and keep the patient out of shock. Medication for nausea and pain control are included as is a low fat diet as soon as the patient is willing to eat. As dramatic as the diarrhea is, most patients have an equally dramatic improvement in the first 24 hours of hospitalization and the average dog is out of the hospital after three days total.&nbsp;</div><div><br></div><div>Antibiotics are surprisingly controversial in this syndrome and their use depends on many patient factors (such as whether or not there is a fever, white blood cell count, whether or not the expected improvement is achieved, etc.</div><div><br></div><div>Stool can be expected to gradually return to normal over the course of about one week.</div><div><br></div><div>Probiotics (cultures of healthy bacteria) have been recommended to help repopulate the bowel but it is best to start these after recovery is well underway and the intestinal ulcers have healed.</div>'),
(74, 66, '<b>Key points&nbsp;</b><div><br></div><div>- Signs of osteoarthritis may be subtle and easy to miss&nbsp;</div><div>- Early treatment is critical to slow progression of the disease&nbsp;</div><div>- Maintaining lean body weight  is absolutely critical for arthritic patients</div><div>- Newer concepts of arthritis management involve proper exercise to maintain muscle mass and decrease pain</div><div>- Structure-modifying agents are most effective when started early and maintained long term</div><div>- Nonsteroidal anti-inflammatory and analgesic drugs, acupuncture, and physical therapy may be recommended for later stages of the disease</div>'),
(75, 66, '<b>Exactly what is Osteoarthritis?</b>&nbsp;<div><br></div><div>Osteoarthritis is a chronic degenerative disease that may affect any joint but is commonly found in a pets  hip, elbow, shoulder, stifle (knee) , carpus (wrist), hock (ankle) or intervertebral joints (in the spine).  It occurs when cartilage in the joint is damaged, either following a traumatic event or with wear and tear that increases in athletic animals, obese animals, or when the joint is congenitally abnormal.</div><div><br></div><div>Cartilage decreases joint stress by reducing impact on the ends of the bones in joints, like a gelatinous shock absorber.  When cartilage is damaged, a cascade of inflammatory changes occurs, eventually leading to destruction of the cartilage and subsequent damage to the underlying bone.  Cartilage contains no nerves  if your pet is showing any signs of pain, the damage and changes in underlying bone have already begun.</div>'),
(76, 66, '<b>Signs of arthritis include:</b>&nbsp;<div><br></div><div>- Reluctance to take walks of usual length</div><div>- Stiffness (that may disappear once the pet has warmed up)</div><div>- Difficulty climbing stairs, climbing in the car, on the bed or a sofa</div><div>- Difficulty rising from rest</div><div>- Limping</div><div>- Abnormal gait</div><div>- Licking of a single joint</div><div>- Acting withdrawn, spending less time playing with family (which is often misunderstood as a sign of aging)</div><div>- Soreness when touched</div><div>- Rarely, aggression when touched or approached</div>'),
(77, 66, '<b>Exactly what can I do?&nbsp;</b><div><br></div><div><b></b>Weight Reduction:<b></b> Ask your doctor about your pets body condition score (BCS), which should be normal (5/9) or slightly underweight (4/9).  If your pet is overweight, discuss a weight loss diet with your veterinarian.</div><div><br></div><div>Controlled Exercise:  Low-impact exercise is best; swimming or walking through shallow water is ideal.  Leash walking and controlled jogging are also acceptable.&nbsp;\r\n</div><div><br></div><div>Nutraceuticals:  Synergistic combinations of nutraceuticals such as glucosamine/chondroitin sulfate contain compounds that support cartilage structure, prevent further deterioration, suppress inflammation, and reduce free radical damage.</div><div><br></div><div>Injectable Chondroprotective Agent: Talk to your veterinarian about an injectable agent that may also help preserve cartilage in the joints.</div><div><br></div><div>Acupuncture and Massage: Both of these therapies may provide additional non-drug pain control.</div><div><br></div><div>Prescription Drugs: Drugs are available that can reduce inflammation and suppress pain in dogs with more advanced disease.  Side effects can be minimized by monitoring your dog\'s blood work regularly.</div>'),
(78, 67, 'Bacterial diarrheas are generally a nuisance for the adult animal but can be lethal to a small puppy, kitten, or even a human baby.  Most of these problems stem from contaminated food or fecal contaminated environment. Raw food diets for pets dramatically increase the risk of human exposure. Since these conditions are also human diseases, it is helpful to have some understanding of what they are even if there are no young puppies or kittens or immune-suppressed people or animals at home. In general, when it comes to bacterial diarrhea, the smaller and less mature the patient is, the more serious the infection.'),
(79, 67, '<b>Campylobacter&nbsp;</b><div><br></div><div>Campylobacter species are a group of bacteria capable of causing diarrhea in dogs, cats, humans, and other animals. They have a unique curved appearance under the microscope and are said to be sea gull-shaped.  They are difficult to isolate as they grow in conditions of low oxygen (making them microaerophilic as opposed to being aerobic or anaerobic bacteria). With regard to pets, Campylobacter are generally a problem for the very young. Puppies and kittens do not have mature immune systems yet; plus, because they are small, fluid loss from diarrhea hits them much harder. Furthermore, puppies and kittens are more likely to be housed in groups  where fecal cross-contamination is common so they may be more likely to become infected than adult animals.   Adult animals commonly have Campylobacter organisms living in their intestines but they do not experience any sickness due to it.&nbsp;</div><div><br></div><div>In humans, Campylobacter infection is a leading cause of gastrointestinal (GI) disease; infected dogs and cats can carry the organism and spread it even if they do not have symptoms themselves.  For this reason, pets used for therapy in assisted living communities and similar situations should be screened for Campylobacter by fecal culture before exposure to people with suppressed immunity. Humans are also infected by consumption of contaminated food, water, or raw milk; only 6% of human Campylobacter infections are attributed to dog exposure.  That said, exposure to a dog with diarrhea triples a persons risk for developing enteritis from Campylobacter jejuni or Campylobacter coli. Studies screening pet animals for inapparent Campylobacter infections have found surprisingly high incidences of inapparent infection. In one study in the Midwest, 24% of 152 healthy cats were positive, for example.&nbsp;</div><div><br></div><div>After one consumes Campylobacter organisms, they travel to the lower small intestine, attach, and begin to multiply.  They produce a toxin that destroys the lining of the intestine with the result being a bloody, mucous diarrhea (though occasionally a more watery diarrhea is described).  Sometimes a fever results, appetite becomes poor, and vomiting can occur.  Incubation is 2 to 5 days.  The organism can survive as long as a month in environmental feces.&nbsp;</div><div><br></div><div>Diagnosis is made by seeing the sea gull-shaped organisms under the microscope; however, there are so many bacterial organisms on a fecal sample that finding the culprit can be tricky. For this reason, a culture is often performed as a more accurate test. Because the organism is microaerophilic, specific culture requirements must be met; the facilities of a reference laboratory are needed.&nbsp;</div><div><br></div><div>Treatment is with appropriate antibiotics. Erythromycin is currently considered the drug of choice.</div>'),
(80, 67, '<b>Salmonella</b>&nbsp;<div><br></div><div>Most people are somewhat familiar with Salmonella.  They know it represents a type of food poisoning, probably know it is associated with diarrhea that can be severe, and may even know that Salmonella species are bacteria.  Most human cases of Salmonella infection cause fever, diarrhea, and cramping that go away on their own, but in children it can produce more severe disease. As with Campylobacter, the young are more susceptible to more severe illness because they are smaller and do not have mature immunity.  The same is true with puppies and kittens; adult animals are almost never affected by Salmonella infection.&nbsp;</div><div><br></div><div>There is an important exception to the \"Salmonella is rare in adult dogs\" rule and that is the case of dogs fed a raw food diet.   It has become popular to feed raw foods to pets with the idea that a raw food diet more closely approximates the natural diet that the feline or canine body evolved to consume, and thus such a diet should be healthier than commercially prepared foods. In fact, the cooking of food is central to removing parasites, bacteria, and bacterial toxins from food. A recent study evaluating raw food diets found that 80% of food samples contained Salmonella bacteria and that 30% of the dogs in the study were shedding Salmonella bacteria in their stool. Adult dogs are often asymptomatic but any infected animal or person will shed the organism for at least 6 weeks, thus acting as a source of exposure to other animals or people. Salmonella organisms are  difficult to remove from the environment and easily survive 3 months in soil.  Again, dogs used for therapy around the elderly or children should be cultured for Salmonella.</div><div><br></div><div>There are two syndromes associated with Salmonella: diarrhea and sepsis. Salmonella bacteria, once consumed, attach to the intestine and secrete toxins. The toxins produce diarrhea that can be severe and even life-threatening in the young.  If this were not bad enough, some Salmonella can produce an even more serious part two\" should these bacteria invade the body through the damaged intestine, causing a more widespread and much more serious infection..&nbsp;</div><div><br></div><div>In young animals, the syndrome resulting is similar to that of canine parvovirus, thus similar treatment is expected.</div>'),
(81, 67, '<b>E. Coli</b>&nbsp;<div><br></div><div>Escherichia coli may be the most common bacterial organism in the world. It lives in our intestines naturally and covers the world we live in. Unfortunately, some strains of E. coli are not so neighborly and are capable of producing diarrhea via toxin production. Like the other organisms we have discussed, this is a serious problem for the very young and more of a nuisance for adults.  There are three main types of unfriendly E. coli: Enterotoxic E. coli, enterohemorrhagic E. coli, and enteropathogenic E. coli.&nbsp;</div><div><br></div><div>Enterotoxigenic E. coli are a common cause of diarrhea in young animals as well as human infants, and are responsible for the famous travelers diarrhea. These bacteria produce what is called an enterotoxin in the upper small intestine. This toxin, similar to the toxin of cholera, causes the intestine cells to secrete the body\'s fluid into the intestine creating spectacular watery diarrhea and what can be life-threatening dehydration for smaller living creatures.  Young pigs, cattle, and other livestock are commonly lost to this kind of dehydration. Again, the younger and smaller the patient is, the more serious this infection is.&nbsp;</div><div><br></div><div>Enteropathogenic E. coli also produce diarrhea in humans and animals. Rather than a secretory diarrhea as above, they simply destroy the intestinal cells where they attach. Diarrhea still results but it creates more damage to the intestinal lining.&nbsp;\r\n</div><div><br></div><div>Enterohemorrhagic E. coli is similar to enteropathogenic E. coli but with more associated inflammation. This type does not seem to be a problem for small animals though they can carry it asymptomatically.&nbsp;</div><div><br></div><div>It would seem that antibiotics would be the obvious treatment for a bacterial disease, yet for E. coli it is surprisingly controversial.  It seems that the use of antibiotics can enhance the synthesis of toxins by these bacteria; plus, oftentimes antibiotic use only serves to make E. coli more resistant in the GI tract. Antibiotics are generally reserved for those animals (or people) who seem the most sick or who have evidence of bacterial invasion in the bloodstream. Basically treatment is supportive care until the patient\'s immune system regains the upper hand.</div>'),
(82, 67, 'In Conclusion\r\n\r\nBacterial diarrheas are an especially serious consideration in the very young and in the weak or compromised, be they human or non-human. It is not unusual for apparently healthy animals to carry these organisms and shed them into the environment and feeding raw foods greatly increases the risk of this kind of latent infection. If you are considering raw food diets, especially if there is someone in the home who is very young or who has a compromised immunity, discuss prevention of these infections with your veterinarian.'),
(83, 68, 'Glaucoma is an eye disease where by the pressure within the eye becomes elevated. It can cause significant pain and lead to blindness. Dogs and cats with primary glaucoma are believed to have an anatomic or biochemical problem that affects how fluid drains from the eye, so the onset can be spontaneous. Secondary glaucoma results from another disease process within the eye. Glaucoma usually requires lifelong treatment unless the underlying cause can be reversed or treated successfully.&nbsp;<div><br></div><div>Inside the eye, a clear fluid called aqueous humor circulates in the front chamber between the cornea and the pupil. The aqueous humor leaves the eye through a small sieve-like structure between the base of the cornea and front of the iris. Normal pressure is a dynamic function of the balance between aqueous production and drainage. When the drainage sieve does not work probably or becomes clogged, or when the flow of aqueous through the pupil becomes obstructed, intraocular pressure can increase to an unsafe level. This is particularly true if aqueous production continues at a normal level. Glaucoma is never caused by over production of aqueous humor. It is always a drainage problem.&nbsp;</div><div><br></div><div>Glaucoma occurs far more frequently in dogs (0.675%) than in cats (0.197%). Primary, hereditary, breed-related glaucoma is most commonly seen in purebred dogs. Cats usually have secondary glaucoma that is associated with chronic inflammation of the iris (uveitis) or with intraocular tumors. Primary glaucoma in cats is very rare but Siamese and Burmese cats may be predisposed. Over forty different breeds of dogs are predisposed to glaucoma, with common ones being the cocker spaniel, beagle, basset, Akita, chow chow, Samoyed, Bouvier de Flandres, Shih Tzu and Chinese Shar Pei.</div><div><br></div><div>Glaucoma can be a very painful disease for pets - more so than for people - as the intraocular pressure can become rapidly elevated to levels much higher than typically occur in people. In people, the pain feels like a constant bad headache. Normal intraocular pressure in people is 12-22 mmHg. The normal pressure for dogs and cats is 10-25 mmHg. With glaucoma in cats and dogs, the pressure may go up to 30 mmHg and higher. Values above 50 mmHg rapidly cause blindness, are painful and may cause the eye to stretch and enlarge.</div><div><br></div><div>An affected eye may look normal to a pet owner when the glaucoma is mild. Early signs can include a bloodshot eye, cloudy cornea, dilated pupil, and squinting/holding the eye closed. Over time, the eye size can increase and it may bulge.&nbsp;</div><div><br></div><div>Unfortunately in cases of severe glaucoma, the eye is often permanently blind by the time of diagnosis. Pets can act normal with vision in just one eye, which is one reason glaucoma is often diagnosed late in the diseases course.<br></div>'),
(84, 68, '<b>Diagnosis and Treatment</b><div><br></div><div>Glaucoma can be detected by measurement of eye pressure using an instrument called a tonometer. Tonometry can be done by your veterinarian during the eye exam. Pressures are measured in both eyes and then compared.&nbsp;</div><div><br></div><div>If glaucoma is found, then numerous medications are available to lower the pressure. All glaucoma medications used in dogs and cats are medications that have been manufactured for human glaucoma. The treatment of glaucoma requires faithful, consistent application of the medications. These are not medications that can be skipped or forgotten without risk of the eye pressure rapidly deteriorating.&nbsp;</div><div><br></div><div>Some cases of primary glaucoma are also treated with surgery. A major emphasis in secondary glaucoma is to determine the underlying cause and to treat it, as well as the elevated pressure. If primary glaucoma is diagnosed in one eye, it is common for the other eye to be started on preventative medication because both eyes are prone to the disease.&nbsp;</div><div><br></div><div>Removal of the eye (enucleation) is sometimes recommended. Examples include a blind eye in which the glaucoma does not respond to medications; any eye containing a tumor; when the eye is blind and the owner cannot afford glaucoma medications; and when infection is the cause of the glaucoma and it does not respond well to appropriate therapy.</div>'),
(85, 68, '<b>Prognosis</b>&nbsp;<div><br></div><div>In most cases, glaucoma is not curable and once vision is lost it will not return. With primary glaucoma, vision is often lost over time, even with appropriate treatment. For secondary glaucoma, prognosis depends on the underlying disease and its response to treatment.</div>'),
(86, 69, 'The normal lens of the eye is a focusing device. It is completely clear and is suspended in position by tissue fibers (called zonules) just inside the pupil.  The pupil opens and closes to control the light entering the eye so as to project an image onto the retina in the back of the eye, the way a projector projects an image onto a movie screen. The lens focuses the projected image in a process called accommodation.  The focusing power of the dogs lens is at least three times weaker than that of a human lens, while a cats lens is at best half the power of a humans. (Dogs and cats have a sense of smell at least 1,000 times more accurate than ours and this is their primary means of perceiving the world.)'),
(87, 69, '<b>Anatomy First</b>&nbsp;<div><br></div><div>Despite its clarity, the lens is in fact made of tissue fibers. As the animal ages, the lens cannot change its size and grow larger; instead, it becomes more compact with fibers. The older lens, being denser, appears cloudy. This condition is called nuclear sclerosis and is responsible for the cloudy-eyed appearance of older dogs. The lenses with nuclear sclerosis may look cloudy but they are still clear and the dog can still see through them; these are not cataracts.&nbsp;</div><div><br></div><div>The fibers making up the lens come together in the center of the lens forming a Y shape that is sometimes visible when one looks into the eye. These Y-shaped lines are often called the sutures of the lens.&nbsp;</div><div><br></div><div>The lens is enclosed in a capsule that, if disrupted, allows the immune system to see the lens proteins for the first time, recognize them as foreign, and attack. The resulting inflammation (a form of uveitis) is painful and can be damaging to the eye. A cataract can result from this inflammation or from any of numerous other reasons listed below.</div>'),
(88, 69, '<p>\r\n\r\n</p><p><strong>A cataract is an opacity in the lens.</strong></p><p><strong>A Note on Diabetes Mellitus in Dogs</strong></p><p>Cataracts can be congenital (born with it), age-related; of genetic origin (the most common cause); caused by trauma; by dietary deficiency (some kitten milk replacement formulas have been implicated); by electric shock; or by toxin. The patient with a cataract is not able to see through the opacity. If the entire lens is involved, the eye will be blind.</p><p>Many things can cause the lens to develop a cataract. One cause is <a target=\"_blank\" rel=\"nofollow\" href=\"https://veterinarypartner.vin.com/doc/?id=4952222&amp;pid=19239\">diabetes mellitus</a>. In this condition the blood sugar soars as does the sugar level of the eye fluids. The fluid of the eyes anterior chamber is the fluid that normally nurtures the lens but there is only so much glucose that the lens is able to consume. The excess sugar is absorbed by the lens and transformed into sorbitol. Sorbitol within the lens unfortunately draws water into the lens, causing an irreversible cataract in each eye. Cataracts are virtually unavoidable in diabetic dogs no matter how good the insulin regulation is; diabetic cats have alternative sugar metabolism in the eye and do not get cataracts from diabetes.</p>\r\n\r\n<br><p></p>'),
(89, 69, '<p>\r\n\r\n</p><p><strong>What Else Could it Be?</strong></p><div><div><div><img width=\"243\" alt=\"\" src=\"https://veterinarypartner.vin.com/apputil/image/handler.ashx?imgid=4128664&amp;w=242&amp;h=187\" height=\"188\"><div>This is not a cataract. This dog has nuclear sclerosis making the eye appear cloudy. Photo by Joel Mills via Joel Mills via Wikimedia Commons <a target=\"_blank\" rel=\"nofollow\" href=\"http://creativecommons.org/licenses/by-sa/3.0/legalcode\">Wikipedia Commons</a>)</div><div></div></div></div></div><p>Many owners are not really able to tell which portion of the eye looks cloudy. Cloudiness on the cornea, as caused by other eye diseases, can be mistaken for a cataract by an inexperienced owner. Also, in dogs, the lens will become cloudy with age as more and more fibers are laid down as described above. Nuclear sclerosis, as described, can mimic the appearance of a cataract, yet the eye with this condition can see and is not diseased. It is a good idea to have your veterinarian examine your pet if you think there is a cataract as you could be mistaken.</p><p><strong>Why is it Bad to have a Cataract?</strong></p><p>The area of the lens involved by the cataract amounts to a spot that the patient cannot see through. If the cataract involves too much of the lens, the animal may be blind in that eye and there could be cataracts in both eyes, which means the pet could be rendered completely blind.</p><p>A cataract can luxate, which means that it can slip from the tissue strands that hold it in place. The cataractous lens can thus end up floating around in the eye where it can cause damage. If it settles so as to block the eyes natural fluid drainage, glaucoma (a buildup in eye pressure) can result, leading to pain and permanent blindness. A cataract can also cause glaucoma when it absorbs fluid and swells so as to partially obstruct fluid drainage.</p><p>Cataracts can begin to dissolve after they have been there long enough. While this sounds like it could be a good thing, in fact it is a highly inflammatory process. The deep inflammation in the eye creates a condition called uveitis, which is in itself painful and can lead to glaucoma. If there is any sign of this type of inflammation in the eye, it must be controlled prior to any cataract surgery.</p><p>A small cataract that does not restrict vision is probably not significant. A more complete cataract may warrant treatment. Cataracts have different behavior depending on their origin. If a cataract is a type that can be expected to progress rapidly (such as the hereditary cataracts of young cocker spaniels) it may be beneficial to pursue treatment (i.e. surgical removal) when the cataract is smaller and softer, as surgery will be easier.</p>\r\n\r\n<br><p></p>'),
(90, 69, '<p>\r\n\r\n</p><p><strong>What Treatment is Available?</strong></p><div><div><div><img width=\"283\" alt=\"\" src=\"https://veterinarypartner.vin.com/apputil/image/handler.ashx?imgid=4128665&amp;w=283&amp;h=244\" height=\"244\"><div>This lens has luxated. Normally the lens would be behind the pupil. Here the pupil is visible behind the lens. Photo by Dr. Rhea Morgan</div><div></div></div></div></div><p>Cataract treatment generally involves surgical removal or physical dissolution of the cataract under anesthesia. This is invasive and expensive and is not considered unless it can restore vision or resolve pain. Pets with one normal eye and one cataractous eye can still see with their good eye and probably do not need surgery.</p><p><strong>Determining if a Dog is a Candidate for Cataract Removal</strong></p><p>Obviously, the patient must be in good general health to undergo surgery; diabetic dogs must be well regulated before cataract surgery. Also, it should be obvious that in order for a patient to be a good candidate for surgery, the patient must have a temperament conducive to getting eye drops at home. Pre-anesthetic lab work can be done with the patients regular veterinarian. Some ophthalmologists prefer that patients have their teeth cleaned prior to surgery to minimize sources of infection for the eye.</p><p>A complete examination of the eye should be performed. If your veterinarian is not comfortable treating cataracts or does not have the appropriate equipment, your pet may be referred to a veterinary ophthalmologist.</p><p>It is not possible to see the retina through a cataract; a test called an electroretinogram can determine if the eye has a functional retina and can benefit from cataract surgery. Ultrasound of the eye can be used to look for retinal detachments. If the eye has a blinded retina, there is no point to subjecting the patient to surgery. Inflammation in the eye will require treatment prior to surgery. Sometimes other eye drops are prescribed for a period before surgery depending on the veterinarians preference.</p><p><strong>Cataract Removal: Phacoemulsification and Surgical Removal<br></strong></p><div><div><div><img width=\"430\" alt=\"\" src=\"https://veterinarypartner.vin.com/apputil/image/handler.ashx?imgid=4128238&amp;w=&amp;h=\" height=\"368\"><div>Graphic by VIN</div><div></div></div></div></div><p>Historically, removing the cataract meant surgically cutting into the eye and physically removing the lens. This is still done for older patients whose lenses are compact. For younger patients in whom the lens is soft, a technique called phacoemulsification is preferred.</p><p>This technique has become the most common method of removing cataracts in dogs. Here, the lens is broken apart by sound waves and sucked out with a gadget similar to a small vacuum-cleaner.</p><p>In either case, the patient is given a drug to induce complete paralysis during the surgery so as to prevent any blinking or eye movement. A ventilator is attached to the patient as the patient will be unable to breathe without external assistance. After the lens is removed, an artificial lens is implanted. (Without the prosthesis, the dogs vision will be approximately 20/800, and objects will appear to be reversed, as in a mirror.)</p><p>After surgery, the pet must wear an Elizabethan collar for a good 3 weeks, and eye drops to reduce inflammation will be needed for several months. A harness may be recommended for walks instead of a collar to reduce pressure on the head and eye fron pulling. There will be a schedule of recheck appointments.</p><p><strong>Complications</strong></p><p>Some degree of uveitis (deep inflammation) is unavoidable. This can cause a pupil constriction reaction that can increase the risk to scarring within the eye. Eye drops to keep the pupil dilated are usually effective in preventing this but not always. Inflammation in the eye will resolve over weeks to months after surgery. Success rate is higher for cataract surgery if there is minimal inflammation in the eye prior to surgery, thus pre-operative anti-inflammatory eye drops are frequently prescribed.</p><p>Another complication involves the development of opacities on the remaining lens capsule. In humans, laser surgery is used to remove the lens capsule but in dogs, the capsule is too thick for this. Some ophthalmologists prefer to remove the capsule as a preventive measure. The portion of the capsule that is involved in this reaction is present in young dogs but not in adult dogs.</p><p>Bleeding after surgery can be an enormous complication and can easily be caused by excess barking or activity after surgery. Small bleeds are of little consequence but a large bleed could ruin vision.</p><p>Glaucoma can develop at any time after cataract surgery. This complication is not only blinding but painful as well. The risk of this complication has been decreased by placing a prosthetic lens (a formerly uncommon but now fairly standard procedure) but dogs who start off with hypermature (dissolving) cataracts or have an unusually long surgery time tend to have an increased risk for this complication.</p><p><strong>Overall, a 95 percent vision rate is described immediately after cataract surgery with 80 percent having long-term vision success.</strong></p><p><strong>Before embarking on the adventure of cataract surgery, be sure to obtain a clear explanation from your veterinarian or ophthalmologist of exactly what the home care will involve.</strong></p><p><strong>What if the Cataract goes Untreated?</strong></p><p>A cataract by itself does not necessarily require treatment. If there is no associated inflammation or glaucoma and the only problem is blindness, it is perfectly reasonable to have a blind pet. Blind animals have good life quality and do well though it is important not to move furniture around or leave any hazardous clutter in the home. Some dogs, however, become anxious or even aggressive when they lose their vision. Restoring vision for the pet is weighed against risk and expense and is a decision for each owner to make individually. Many cataracts will progress to a hypermature state where they will begin to dissolve as described and anti-inflammatory eye drops are needed as mentioned. </p><p><strong>Can Eye Drops Dissolve Cataracts?</strong></p><p>Products containing N-acetylcarnosine have been marketed to dissolve cataracts and have led to a great deal of false hope. N-acetylcarnosine is an antioxidant eye drop that may have beneficial effects to the eye but they do not include any sort of dissolution of a mature cataract. For smaller cataracts, it may be possible to dilate the pupil so that the pet can see around the cataract but there is some controversy about doing so as these medications have other effects in the eye. Ask more detailed questions of your veterinarian</p>\r\n\r\n<br><p></p>'),
(91, 70, 'Most diabetic dogs will develop cataracts and go blind. This FAQ is designed to assist the owners of diabetic dogs in knowing what to expect and to make decisions regarding cataract surgery.');
INSERT INTO `tbl_pet_library_content` (`content_id`, `library_id`, `article_contents`) VALUES
(92, 70, '<p>\r\n\r\n</p><p><strong>What is a Cataract?</strong></p><p>A cataract is an opacity in the lens of the eye. The entire lens may be involved or just a part of it. The patient will not be able to see through the opacity.</p><p><strong>Why do Diabetic Dogs get Cataracts?</strong></p><p>The lens of the eye is round, hard, and normally as clear as glass. Looking at the lens it is hard to believe it is a piece of living tissue. The lens is suspended by fibers that can adjust its position so that one can focus vision. The lens is encased in a capsule and depends on the fluids of the eye for nutrients. The lens does not receive a direct blood supply.</p><p>Normally, the lens absorbs glucose from the eye fluids, using most of this for its own energy needs. Some of the excess is converted to another sugar called sorbitol. When there is excess sugar in the eye fluids, as in diabetes mellitus, there is excess sorbitol produced. Sorbitol pulls water into the lens, which in turn disrupts lens clarity and causes the cataract. Fructose is also produced from the excess glucose and also contributes to this water imbibition.</p><p>Cataracts do not necessarily imply poor diabetic control. Even well controlled dogs still can get cataracts.</p><p><strong>How Long does it Take to go Blind?</strong></p><p>Generally the cataract has matured and the dog is blind in a matter of weeks.</p><p>Until recently, blindness in a diabetic dog was basically a foregone conclusion but there is a new product called Kinostat&nbsp;that has changed that outlook. To review, the lens absorbs glucose from the fluids of the eye and uses this glucose as nutrition. Any extra glucose that is absorbed into the lens is converted to sorbitol by an enzyme called aldose reductase. Sorbitol pulls water into the lens to prevent the lens from becoming dehydrated. This is all well and good but in the diabetic state there is lots of excess glucose and the excess glucose gets converted to excess sorbitol which, in turn, pulls so much water into the lens that clarity and function are disrupted and a cataract is formed. Kinostat is an aldose reductase inhibitor that curtails sorbitol production. Early use of Kinostat may significantly delay or even completely prevent the development of cataracts.</p><p>Kinostat is a preventive only and will not reverse cataract formation that has already occurred. Kinostat is unfortunately not yet commercially available.</p><p><strong>What Does it Mean to say that a Cataract is Mature?</strong></p><p></p><div><div><img width=\"156\" alt=\"\" src=\"https://veterinarypartner.vin.com/apputil/image/handler.ashx?imgid=4128614&amp;w=152&amp;h=100\" height=\"103\"><div>A mature cataract. Photo by Dr. Rhea Morgan.</div><div></div></div></div><p></p><p>A cataracts maturity is determined by how much visual impairment the pet is believed to have. Since we cannot ask a dog to read an eye chart, we must determine this by visually inspecting the eye. A light is used to look into the eye and view the colorful area at the back of the eye called the tapetum. (This is the area that flashes or appears colored in certain lighting.) When less than 10 percent of the tapetum is obstructed, the cataract is very young and does not significantly change vision. When 10-50 percent of the tapetum is obstructed, this cataract is called early immature. When 51-99 percent is obstructed the cataract is late immature. The mature cataract obstructs the entire tapetum. Ideally a cataract is removed in the early immature stage for the lowest surgical complication rate.</p><p></p><div><div><img width=\"285\" alt=\"\" src=\"https://veterinarypartner.vin.com/apputil/image/handler.ashx?imgid=4128613&amp;w=&amp;h=\" height=\"216\"><div>A mature cataract. Photo by Dr. Jane Bondt</div><div></div></div></div><p></p><p>When a cataract is hypermature, it is starting to liquefy and dissolve. This can actually lead to restoring vision, which sounds like a positive turn of events; unfortunately the dissolution process is quite inflammatory. The resulting inflammation can be painful and can damage the eye even more.</p><p>All cataracts do not progress all the way to hypermature and may stay static or progress at changing rates; however, diabetic cataracts are notorious for reaching hypermaturity and creating inflammation. </p><p><strong>What is Uveitis?</strong></p><p>Uveitis is inflammation of the eye\'s uveal tract, which consists of the eye\'s vascular tissues. In this situation, uveitis is the inflammation that results when the hypermature cataract begins to liquefy. Uveitis is painful and tends to cause the eye to become reddened and the pupil to constrict. When a pet has uveitis before surgery, success (pain-free vision) occurs in only 50 percent of cases 6 months after surgery as opposed to 95 percent of cases for whom there was no uveitis pre-opertively.</p><p><strong>Can My Dog\'s Vision be Restored?</strong></p><p>Maybe; it depends on the health of the eye excluding the cataract. If the only thing wrong with the eye is the cataract and the patient\'s diabetes mellitus is well regulated, surgery can remove the cataract and place an artificial lens. If the eye is deeply inflamed or is otherwise damaged, the eye may be blind even without a cataract. A veterinary ophthalmologist can evaluate the eye to determine the feasibility of cataract surgery.</p><p></p><div><div><img alt=\"\" src=\"https://veterinarypartner.vin.com/AppUtil/Image/handler.ashx?imgid=4118338&amp;w=&amp;h=\"><div></div></div></div><p></p><p>It is important to note that there are numerous eye drops advertised that claim to dissolve cataracts. None of these products actually work and wasting time with them may actually allow uveitis to set in and make for a much worse prognosis for vision.</p><p><strong>Is it Cruel to keep a Dog Blind?</strong></p><p>Not at all. Dogs do not depend on vision the way humans do. A blind dog can get along very well as long as the furniture isnt moved and the dog is properly supervised.</p><p>For tips on helping a blind dog adapt:</p><p>There are many medical conditions that render a dog blind and as long as the condition is not painful, the dog can live a normal life as a successful and happy pet.</p><p><strong>Cataract Surgery: What is the First Step?</strong></p><p>The first step is a consultation with your regular veterinarian. Your dogs diabetes must be well regulated before surgery is considered. If pre-operative lab tests show nothing to preclude anesthesia, your veterinarian may refer you to veterinary ophthalmologist, as clinics do not usually have the specialized equipment necessary. A regular veterinarian is not qualified to perform cataract surgery.</p><p><strong>What Happens at the Ophthalmologist\'s?</strong></p><p>It is necessary to determine if the eye is going to be visual after cataract surgery. There is, after all, no point to performing this surgery if the eye is going to be blind anyway. The most important test is called an ERG (an electroretinogram). This test checks the retina for electrical activity which, if present, indicates the eye should be able to see after the cataract is removed.</p><p>In addition to the ERG, the ophthalmologist will check for uveitis. It should be treated before surgery to minimize the inevitable inflammation after surgery.</p><p><strong>What Kind of Surgical Procedures are Done?</strong></p><p>There are two types of surgery: lens extraction and phacoemulsification. With lens extraction, the incision tends to be larger, the post-operative inflammation is greater, and the potential for leaving bits of lens behind is also greater.</p><p>With phacoemulsification an ultrasonic instrument is used to liquefy the lens and a sort of vacuum cleaner is sucks the lens away. This procedure is more difficult if the patient is older (and the lens is thus harder in consistency). This is the preferred method for diabetic patients.</p><p>After either surgery an artificial lens is usually placed for optimal post-operative vision.</p><p><strong>What Kind of after Care is Needed?</strong></p><p>The patient will need to wear an Elizabethan collar after surgery to protect the eye. Cortisone eye drops are needed for probably several weeks. Oral anti-inflammatories will be needed for weeks to months after. Drops to keep the pupil dilated will also be used.</p><p><strong>What Kind of Complications are Possible?</strong></p><p>Complications to consider are:</p><ul><li>Long-term uveitis (probably of most concern for diabetic patients)</li><li>Opacification of the lens capsule (usually correctable with laser)</li><li>Corneal clouding (can be managed with 5 percent saline eye drops 4 to 6 times daily)</li><li>Bleeding into the eye</li><li>Glaucoma</li><li>Retinal detachment (particularly if the cataract is hypermature)</li></ul><p><strong>Should Surgery be Done on both Eyes?</strong></p><p>It is important to remember the old saying that the one-eyed man is king among the blind. A dog need only have one cataract removed to have vision restored. Doing both eyes is an option to discuss with the ophthalmologist as some dogs need all the vision they can get.</p><p>Cataract surgery requires committed patient care both in the hospital and at home. Surgery also requires a financial commitment (which varies regionally and between different practices); your regular veterinarian can get a sense for average costs in your community when you are ready to consider restoration of your dogs vision.</p>\r\n\r\n<br><p></p>'),
(93, 71, '<b>Why Might this Procedure be Necessary?</b>'),
(95, 72, 'The normal lens of the eye is a focusing device. It is completely clear and is suspended in position by tissue fibers (called zonules) just inside the pupil.  The pupil opens and closes to control the light entering the eye so as to project an image onto the retina in the back of the eye, the way a projector projects an image onto a movie screen. The lens focuses the projected image in a process called accommodation.  The focusing power of the dogs lens is at least three times weaker than that of a human lens, while a cats lens is at best half the power of a humans. (Dogs and cats have a sense of smell at least 1,000 times more accurate than ours and this is their primary means of perceiving the world.)'),
(96, 73, '&nbsp; &nbsp; &nbsp;Feline viral rhinotracheitis (FVR) is an upper respiratory infection of the nose and throat in cats. It is caused by, and also know as feline herpesvirus 1 (FHV-1). Cats of all ages are susceptible, but kittens are at a higher risk and may be infected at about five weeks of age. Pregnant cats or those suffering from a lowered immunity due to a pre-existing disease are also at higher risk.'),
(97, 73, '<p></p><p><b>SYMPTOMS AND TYPES</b></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;Some infected cats can remain without symptoms, yet\r\nact as carriers and spread the infection to other non-infected cats. The\r\nfollowing symptoms may also be sporadic in a FHV-1 carrier:</p><p></p><ul><li>Sudden, uncontrollable attacks of sneezing</li><li>Watery or pus containing nasal discharge</li><li>loss of sense of smell</li></ul><p></p><p></p>'),
(98, 74, 'Educated man'),
(99, 71, '<p>\r\n\r\n</p><p>Glaucoma is an eye disease where by the pressure within the eye becomes elevated. It can cause significant pain and lead to blindness. Dogs and cats with primary glaucoma are believed to have an anatomic or biochemical problem that affects how fluid drains from the eye, so the onset can be spontaneous. Secondary glaucoma results from another disease process within the eye. Glaucoma usually requires lifelong treatment unless the underlying cause can be reversed or treated successfully. </p><div><br></div><div>Inside the eye, a clear fluid called aqueous humor circulates in the front chamber between the cornea and the pupil. The aqueous humor leaves the eye through a small sieve-like structure between the base of the cornea and front of the iris. Normal pressure is a dynamic function of the balance between aqueous production and drainage. When the drainage sieve does not work probably or becomes clogged, or when the flow of aqueous through the pupil becomes obstructed, intraocular pressure can increase to an unsafe level. This is particularly true if aqueous production continues at a normal level. Glaucoma is never caused by over production of aqueous humor. It is always a drainage problem. </div><div><br></div><div>Glaucoma occurs far more frequently in dogs (0.675%) than in cats (0.197%). Primary, hereditary, breed-related glaucoma is most commonly seen in purebred dogs. Cats usually have secondary glaucoma that is associated with chronic inflammation of the iris (uveitis) or with intraocular tumors. Primary glaucoma in cats is very rare but Siamese and Burmese cats may be predisposed. Over forty different breeds of dogs are predisposed to glaucoma, with common ones being the cocker spaniel, beagle, basset, Akita, chow chow, Samoyed, Bouvier de Flandres, Shih Tzu and Chinese Shar Pei.</div><div><br></div><div>Glaucoma can be a very painful disease for pets - more so than for people - as the intraocular pressure can become rapidly elevated to levels much higher than typically occur in people. In people, the pain feels like a constant bad headache. Normal intraocular pressure in people is 12-22 mmHg. The normal pressure for dogs and cats is 10-25 mmHg. With glaucoma in cats and dogs, the pressure may go up to 30 mmHg and higher. Values above 50 mmHg rapidly cause blindness, are painful and may cause the eye to stretch and enlarge.</div><div><br></div><div>An affected eye may look normal to a pet owner when the glaucoma is mild. Early signs can include a bloodshot eye, cloudy cornea, dilated pupil, and squinting/holding the eye closed. Over time, the eye size can increase and it may bulge. </div><div><br></div><div>Unfortunately in cases of severe glaucoma, the eye is often permanently blind by the time of diagnosis. Pets can act normal with vision in just one eye, which is one reason glaucoma is often diagnosed late in the diseases course.</div>\r\n\r\n<br><p></p>'),
(100, 61, '<p><b>What is Colitis?</b></p><p>\r\n\r\nThe normal lens of the eye is a focusing device. It is completely clear and is suspended in position by tissue fibers (called zonules) just inside the pupil.  The pupil opens and closes to control the light entering the eye so as to project an image onto the retina in the back of the eye, the way a projector projects an image onto a movie screen. The lens focuses the projected image in a process called accommodation.  The focusing power of the dogs lens is at least three times weaker than that of a human lens, while a cats lens is at best half the power of a humans. (Dogs and cats have a sense of smell at least 1,000 times more accurate than ours and this is their primary means of perceiving the world.)\r\n\r\n<br></p>');
